import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
//import $ from 'jquery'; // Import jQuery
import 'popper.js'; // Popper.js doesn't export anything, so import it as is
import 'bootstrap/dist/js/bootstrap.min.js'; // Import Bootstrap JavaScript


function Uploadvideo() {
     return (

    <div class="uploadVideo">
      <button
        data-toggle="collapse"
        data-target="#demo"
        class="uploadVideo_btn"
      >
        <a href="#0">Upload Video</a>
      </button>
      <form id="demo" class="collapse">
        <div>
          <label>Title</label>
          <input type="text" class="input" name="title" required></input>
        </div>
        <div>
          <label>url</label>
          <input type="text" class="input" name="title" required></input>
        </div>
        <div>
          <button class="cancelBtn">Cancel</button>
          <button class="uploadBtn">Upload</button>
        </div>
      </form>
    </div>
  );
}
function Searchvideo() {
  return (
    <div>
      <label>Search:</label>
      <input type="text" class="searchVideo" name="search"></input>
    </div>
  );
}

export default function Search() {
  return (
    <div class="search">
      <Uploadvideo />
      <Searchvideo />
    </div>
  );
}
